01) A situação do elenco do São Paulo (
@SaoPauloFC
) me preocupa, não apenas pelos contundidos ou desfalques em outros pontos, mas a forma de jogo está deixando o torcedor irritado.

Junto a isso, temos (de forma recente) um departamento médico que possui, aproximadamente, um time inteiro de jogadores contundidos, reféns da maratona de jogos exaustiva que o clube teve, através do preço da conquista do 
@Paulistao
 (o último foi em 2005).

Deu aval aos problemas que temos hoje, com o "impeachment" da presidente Dilma Rousseff (
@dilmabr
), apoiou projetos antitrabalhistas, e que culminou nesta draga em que estamos.
Posso ser plausível ao editorial, mas não sou idiota.

