Text:
Ao ver o editorial do 
@jornalnacional
 quero deixar um aporte aqui... Mesmo que falem, hoje, que "estão do lado da democracia" (não usaram isso literalmente, foram outras palavras), é bom lembrar que este canal apoiou a ditadura militar.

Além do fato de que, esportivamente, o clube precisa se reinventar e sua direção, presidida por 
@juliocasares_SP
, deve entender a necessidade de ser mais enérgico e contundente no que concerne a desempenho, resultados e fundamento.

O 
@SaoPauloFC
 verdadeiramente precisa de uma reestruturação mais profunda para sair do buraco que as administrações anteriores colocaram (Juvenal Juvêncio, Carlos Miguel Aidar e Carlos Augusto de Barros e Silva), que criaram, em sequência, uma dívida monstruosa.

Olha... A hipocrisia reinando entre os deputados governistas (neste caso específico, da presidente da CCJ, Bia Kicis - 
@Biakicis
).
Deixo minha solidariedade a deputada federal 
@JoeniaWapichana
 pela defesa dos povos indígenas.

